                    <img src="" alt="Logo de la conferencia"/>
                </div>
                <div>
                    <img src="" alt="Avatar"/>
                    <h1>Richard <br/>Kaufman</h1>
                </div>
                <div>
                    <p>Frontend Engineer</p>
                    <p>@sparragus</p>
                </div>
                <div>
                    #platziconf
                </div>
            </div>
        )
    }
}

export default Badges;
